use rand::prelude::*;
use rand::SeedableRng;
use rand_distr::Normal;

fn create_prob_table(s: usize) -> Vec<Vec<f64>> {
    let mut res = vec![vec![0.0; 1001]; 1001];
    for i in 0..=1000 {
        res[i][0] = PROB_HALF[s][i];
        for j in 1..=999 {
            res[i][j] = PROB_ONE[s][if i >= j { i - j } else { j - i }];
        }
        res[i][1000] = PROB_HALF[s][1000 - i];
    }
    res
}

fn main() {
    for s in 1..=30 {
        let prob = create_prob_table(s - 1);
        let mut rng = rand_chacha::ChaCha20Rng::seed_from_u64(42);

        // Generate noises from normal distribution
        let low = 0;
        let high = ((1.5 * (s * s) as f64).round() as usize).min(1000);
        let dist = Normal::<f64>::new(low as f64, (s * s) as f64).unwrap();
        for i in 30..=30 {
            let mut cnt = 0;
            for _ in 0..1000000 {
                let mut prob_0 = 0.0;
                let mut prob_1 = 0.0;
                for __ in 0..i {
                    let noise = dist.sample(&mut rng);
                    let idx = (noise.round() as i64).max(0).min(1000) as usize;
                    prob_0 += prob[low][idx];
                    prob_1 += prob[high][idx];
                }
                if prob_0 > prob_1 {
                    cnt += 1;
                }
            }
            println!("{}: {}", s, cnt as f64 / 10000.0);
        }
    }
}

